import React, { Fragment } from "react";
import { Form } from "reactstrap";

const AddCourse = ()=>
{
    return(

        <Fragment>


            <Form>

            <FormGroup>
    <Label for="userId">
      CourseId
    </Label>
    <Input
      id="userId"
      name="userId"
      placeholder="User Id"
      type="text"
    />
  </FormGroup>
            </Form>
        </Fragment>
    );
}
export default AddCourse;
